import 'bootstrap/dist/css/bootstrap.css';
import './App.css';
import {Button, Container, Form, Row, Col} from 'react-bootstrap';

function ItemizedSpending(props) {
  var temp = ['Jane', 'Jack', 'Joe']

  return (
    <div>
      <h3>Itemized spending</h3>
      <Form onSubmit={props.handleSubmit}>
        <Container>
          <Row>
            <Col><Form.Control type="number" step="0.01" placeholder="XX.YY" name="total" /></Col>
            <Col>
              {
                temp.map((name) => (
                  <Form.Check 
                    id={`default-checkbox`}
                    label={name}
                  />
                ))
              }
            </Col>
          </Row>
        </Container>
        <Button variant="primary" type="submit">
          Submit itemized spending
        </Button>
      </Form>
    </div>
  );
}

export default ItemizedSpending;
